INSERT INTO `crew` VALUES (1,'런닝맨',3,'걷지 말고 뛰어라.','세종특별자치시 세종시','이 크루는 영국에서 최초로 시작되어...','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/4f6c7c72-7b0c-43a8-bb3a-3fb4e1aac813.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/crewinsublogo.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/5f85905d-0dbe-4c0e-9d17-b8f3ef3d23cf.webp','2024-02-17'),(2,'포하항포하항',4,'포항 사나이들의 진짜 러닝.','경상북도 포항시','포항 이곳저곳 뛸 수 있는 곳이라면 어디든 달려가는 사나이들의 러닝 크루입니다.','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/64f84d88-7210-48b8-8d5b-80d3ffad0e5d.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/995fbad0-9093-4eb1-9fa6-ef022db0132a.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/60c11a49-6ec7-4e0d-98dc-4cc2079b3b1a.webp','2022-09-27'),(3,'돌고랭',6,'바다까지 달려보자😜','부산광역시 부산진구','두근거림을 떠올리는 거야','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/c37d6992-7209-4fdf-82be-0d306a374d9d.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/crewinsublogo.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/f8e0786d-0086-4029-8191-9147baa4b989.webp','2024-05-08'),(4,'마이구미',7,'함께 달리는 즐거움','경상북도 구미시','우리는 서로의 에너지를 공유하며, 함께 달리는 즐거움과 성취감을 느끼고자합니다.\n모든 러너들을 환영합니다!\n매주 목요일 19시 진평동 일대를 뜁니다.','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/8e78f818-6593-48e6-b4d0-b98ce2734772.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/f2c24183-ee3d-4b8c-9f0d-e960ad81f876.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/a81b538e-2140-45fe-9537-676a8315f0aa.webp','2019-08-15'),(5,'Lmoi',5,'오늘 뛸 러닝을 내일로 미루지 말자.','인천광역시 중구','I can do this all day.','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/0e489acb-4c0f-4d87-9743-28943195db70.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/210a1884-bdfa-469a-85c9-708c5b00fe12.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/0738461d-2d4c-46ad-b5f0-71a5a6dad37c.webp','2024-04-20'),(6,'RunWave',8,'Ride the Rhythm, Run the Wave','경상북도 구미시','RunWave는 달리기를 사랑하는 사람들이 모여 파도를 타듯 함께 달리는 크루입니다. 우리는 목표를 향해 힘차게 나아가며, 서로의 리듬에 맞춰 함께 성장합니다. 초보부터 마라토너까지, 누구나 환영합니다. 함께 달리며, 새로운 길을 개척하고, 에너지를 나눠보세요. 우리와 함께라면, 그 어떤 도전도 즐거운 파도가 될 것입니다!','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/902dcab7-75f5-4444-a590-f2d20bfcb039.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/crewinsublogo.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/banner.webp','2024-07-30'),(7,'DevRunCrew',8,'Run the Code, Run the World','경상북도 구미시','DevRunCrew는 개발자들이 모여 함께 달리며 성장하는 러닝 크루입니다. 우리는 코드를 작성하듯 체계적으로 목표를 세우고, 달리기를 통해 체력과 집중력을 함께 키워나갑니다. 초보부터 베테랑 개발자까지, 누구나 환영합니다. 코드를 통해 세상을 바꾸듯, 함께 달리며 건강한 라이프스타일을 만들어가요!','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/2a496a02-3a1b-417e-9de4-c90950b8e896.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/crewinsublogo.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/banner.webp','2023-08-16'),(8,'바람달리기',8,'바람처럼, 끝없이 달리자','서울특별시 노원구','바람달리기는 바람처럼 자유롭고 힘차게 달리는 사람들의 크루입니다. 우리는 끝없이 이어지는 길을 함께 달리며, 목표를 향해 끊임없이 나아갑니다. 초보자부터 마라톤 선수까지 누구나 환영하며, 우리와 함께 달리며 건강과 즐거움을 만끽하세요. 바람처럼 가볍게, 그리고 강하게!','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/6a942e5b-1f7a-4a83-9c57-6e409d61f8cb.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/crewinsublogo.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/banner.webp','2018-08-14'),(9,'쭈꾸쭈꾸쭉구미',4,'구미를 달리다','경상북도 구미시','금오산의 정기를 받은 구미 최고의 러닝 크루!','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/cf82d89b-4fe4-441a-8a50-19538e2f0663.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/f6c1db0a-01a3-4ad9-9093-86215e3119ac.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/e73bc7e2-405b-4daf-9286-641622cfad21.webp','2024-03-02'),(10,'Busan Marines',2,'바닷바람과 함께 달리다','부산광역시 수영구','부산의 아름다운 해변을 배경으로 건강하고 활기찬 삶을 만들어가는 부산마린스는 함께 달리며 우정을 나누는 커뮤니티입니다. 정기적인 해변 러닝 모임, 다양한 코스 개발, 마라톤 대회 참가 등을 통해 회원들의 건강 증진과 러닝 실력 향상을 지원합니다. 또한, 해변 정화 활동 등 사회공헌 활동을 통해 지역 사회에 기여하고 있습니다. 부산마린스는 누구나 환영하며, 함께 성장하는 즐거움을 느낄 수 있는 곳입니다.','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/acf399cb-5fdb-4cca-90a2-d893d844c693.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/34e38f57-f163-4206-b3b4-dae27a318104.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/5fc50ec9-32dd-4373-aac6-09a16af6d9de.webp','2022-07-06'),(12,'강남런클럽',7,'같이의 가치','서울특별시 강남구','강남에서 활동하는 크루입니다. \n\n매주 수요일 저녁 8시 토요일 아침 9시에 강남을 달립니다.','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/crewinlogo.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/78043d7d-9ae1-4e6b-9da9-3402a9845499.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/banner.webp','2024-08-14'),(13,'CAU',7,'같이의 가치','서울특별시 동작구','같이의 가치 (관리자가 만든 CAUON 임시 크루 입니다)','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/8a0eeeb2-7503-4537-b758-72ab554fe853.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/b145487f-3e3f-4ca2-9baf-6527145f8ad3.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/94b7ac88-4607-46e3-8c22-7a344046ee77.webp','2019-08-20'),(14,'ㄹㅇㅁㄹㅇㅁㄴ',18,'ㄹㅇㅁㄴㄹㅇㄴㅁ','서울특별시 강남구','ㅇ','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/crewinlogo.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/crewinsublogo.webp','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/banner.webp','2024-08-14'),(15,'금오천 죽을때까지 트래킹',21,'最後まで','경상북도 구미시','금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.금오천을 뛰는 모임 입니다.','https://crewin-bucket.s3.ap-northeast-2.amazonaws.com/crewin/c9f4593a-2724-4003-9ae1-9ce6f048a88e.webp','https://crewin-bucke