INSERT INTO `post` VALUES (2,'지금 바로 참여하세요!','2024-08-13 10:16:41','2024-08-13 10:16:49',1,'STANDARD','',NULL,3),(4,'바람직한 달리기 자세','2024-08-13 10:20:16','2024-08-13 10:20:16',1,'STANDARD','',NULL,2),(5,'서울 러닝 스팟 추천해요~!!\n저는 오늘 남산러닝 예정입니다 ㅎㅎ','2024-08-13 10:21:29','2024-08-13 10:27:01',1,'STANDARD','',NULL,4),(8,'주말에 뛴 잠수교 벙개런에서\n너무 힘들어요\n하하 👟\n#잠수교 #러닝 #서울 #20대 #30대 #40대 #열정 ','2024-08-13 10:34:50','2024-08-13 10:34:50',1,'STANDARD','',NULL,2),(9,'전국 날씨 참고하세요 🌞🌞\n폭염주의보 다들 주의하세요!!!\n#날씨 #폭염주의보 #그래도_러닝_할거임','2024-08-13 10:40:16','2024-08-13 10:40:34',1,'STANDARD','',NULL,4),(10,'1. 회원 관리\n신규 회원 가입은 매달 첫째 주에 진행됩니다.\n기존 회원의 정보 업데이트도 잊지 말고 해주세요.\n\n2. 활동 보고\n매주 활동 후 활동 보고서를 제출해 주세요.\n\n3. 정기 회의 일정\n정기 회의는 매월 12일에 진행됩니다.\n참석 필수이며, 불참 시 사전 통보 부탁드립니다.\n\n4. 문의 사항\n운영 관련 문의는 연락처 또는 이메일로 해주세요.\n여러분의 적극적인 참여와 협조를 부탁드립니다!\n\n감사합니다.','2024-08-13 10:43:31','2024-08-13 10:43:31',0,'NOTICE','🏃‍♂️ 런닝맨 공지사항 🏃‍♀️',1,3),(11,'저도 언젠가 이런거 해보고 싶네요 ㅋㅋㅋ 🏃‍♀️🏃‍♂️ <3','2024-08-13 10:44:28','2024-08-13 10:44:49',1,'STANDARD','',NULL,4),(12,'러닝화 사실 분 있으신가요? 같이 공구해요!','2024-08-13 10:51:49','2024-08-13 10:51:49',0,'STANDARD','',NULL,5),(13,'번개런 뛰고는 역시 치킨치킨 (*BBQ 광고아님)','2024-08-13 12:30:09','2024-08-13 12:45:00',1,'STANDARD','',NULL,7),(14,'오런완 인증합니다 (●\'◡\'●)\n#오런완 #폭염주의보','2024-08-13 12:48:28','2024-08-13 12:48:28',0,'STANDARD','',3,4),(15,'풍경이 맛있어서 뛸 맛 나네요!','2024-08-13 13:06:32','2024-08-13 13:06:32',1,'STANDARD','',NULL,9),(16,'끝나고 뒷풀이도 있을 예정이니 많은 참가 부탁드려요 ^^ \n날은 덥지만 재밌게 러닝해봐요!','2024-08-13 13:27:54','2024-08-14 12:31:39',0,'NOTICE','금주 일요일 형산강변 러닝 많관부!',2,4),(18,'오늘 러닝 완료~!','2024-08-13 15:42:48','2024-08-13 15:42:48',1,'STANDARD','',NULL,7),(20,'공지','2024-08-13 16:24:24','2024-08-13 16:24:24',0,'NOTICE','사진없는 공지',4,7),(21,'덥고 습하지만 그래도 우리는 뛴다ㅏㅏ','2024-08-13 17:04:46','2024-08-13 17:04:46',1,'STANDARD','',NULL,10),(22,'오늘의 러닝 인증 (｡･∀･)ﾉﾞ💦💦','2024-08-13 17:06:27','2024-08-13 17:06:27',1,'STANDARD','',NULL,4),(23,'페이스밀고나가기대작전.. 하프 꿀팁 알려주세요..','2024-08-13 17:07:16','2024-08-13 17:07:16',1,'STANDARD','',NULL,10),(24,'we','2024-08-14 02:43:55','2024-08-14 02:43:55',0,'NOTICE','qweq',NULL,7),(25,'qwe','2024-08-14 02:43:58','2024-08-14 02:43:58',0,'NOTICE','qweqwe',NULL,7),(26,'wqweqwe','2024-08-14 02:44:01','2024-08-14 02:44:01',0,'NOTICE','qweqe',NULL,7),(27,'weqe','2024-08-14 02:44:04','2024-08-14 02:44:04',0,'NOTICE','wqeqweq',NULL,7),(28,'weqwe','2024-08-14 02:44:06','2024-08-14 02:44:06',0,'NOTICE','qweqweq',NULL,7),(30,'예쁜 신발과 좋은 사람들과 함께.\n\n개인적으로 9시가 가장 예쁨','2024-08-14 09:42:00','2024-08-14 09:42:00',1,'STANDARD','',NULL,7),(46,'예령 재영 효진 삼위일체','2024-08-14 10:23:58','2024-08-14 10:23:58',1,'STANDARD','',NULL,7),(47,'공지사항입니다.','2024-08-14 10:56:41','2024-08-14 10:56:41',0,'NOTICE','CAU 공지사항',13,7),(51,'아 힘들다.....','2024-08-14 20:20:01','2024-08-14 20:20:01',0,'STANDARD','',1,8);
